class Solution:
    # Input: "aaceecaaa"
    # Input: "aacecaaa"
    # Output: "aaacecaaa"

    def __init__(self):
        self.s= ""
        self.res=[0,-1]

    def isPalindrome(self):
        left=0
        right=len(self.s)-1
        while left<right:
            if self.s[left]==self.s[right]:
                left+=1
                right-=1
            else:
                return False
        return True

    def findCommonPartByIndex(self,i:int):
        if i<len(self.s)-1 and i >0 and self.s[i-1]==self.s[i+1]:
            left = i - 1
            right = i + 1
            while self.s[left]==self.s[right]:
                if left==0:
                    self.res[0]=max(self.res[0],i)
                    break
                else:
                    left-=1
                    right+=1
        if i<len(self.s)-1 and self.s[i]==self.s[i+1]:
            left = i
            right = i + 1
            while self.s[left]==self.s[right]:
                if left==0:
                    self.res[0]=max(self.res[0],i)
                    self.res[1]=max(self.res[1],i)
                    break
                else:
                    left-=1
                    right+=1


    def shortestPalindrome(self, s: str) -> str:
        self.s=s
        if s=="" or self.isPalindrome():
            return self.s
        for i in range(0,len(s)//2):
            self.findCommonPartByIndex(i)
        if self.res[1]!=self.res[0]:
            return "self.s[2*self.res[0]+1:][::-1]+self.s"
        else:
            return "self.s[2*self.res[0]+2:][::-1]+self.s"
if __name__ == '__main__':
    S=Solution()
    s1="abc"
    s2=""
    print(S.shortestPalindrome(s1))
    print(S.shortestPalindrome(s2))